///  @media (min-width: 129px) {}\\n///\\n/// @example scss - Interval for ems is defined as `0.01` by default\\n///  @include media('>20em') {}\\n///\\n///  /* Generates: */\\n///  @media (min-width: 20.01em) {}\\n///\\n/// @example scss - Interval for rems is defined as `0.1` by default, to be used with `font-size: 62.5%;`\\n///  @include media('>2.0rem') {}\\n///\\n///  /* Generates: */\\n///  @media (min-width: 2.1rem) {}\\n///\\n$unit-intervals: (\\n  'px': 1,\\n  'em': 0.01,\\n  'rem': 0.1,\\n  '': 0\\n) !default;\\n\\n///\\n/// Defines whether support for media queries is available, useful for creating separate stylesheets\\n/// for browsers that don't support media queries.\\n///\\n/// @example scss - Disables support for media queries\\n///  $im-media-support: false;\\n///  @include media('>=tablet') {\\n///    .foo {\\n///      color: tomato;\\n///    }\\n///  }\\n///\\n///  /* Generates: */\\n///  .foo {\\n///    color: tomato;\\n///  }\\n///\\n$im-media-support: true !default;\\n\\n///\\n/// Selects which breakpoint to emulate when support for media queries is disabled. Media queries that start at or\\n/// intercept the breakpoint will be displayed, any others will be ignored.\\n///\\n/// @example scss - This media query will show because it intercepts the static breakpoint\\n///  $im-media-support: false;\\n///  $im-no-media-breakpoint: 'desktop';\\n///  @include media('>=tablet') {\\n///    .foo {\\n///      color: tomato;\\n///    }\\n///  }\\n///\\n///  /* Generates: */\\n///  .foo {\\n///    color: tomato;\\n///  }\\n///\\n/// @example scss - This media query will NOT show because it does not intercept the desktop breakpoint\\n///  $im-media-support: false;\\n///  $im-no-media-breakpoint: 'tablet';\\n///  @include media('>=desktop') {\\n///    .foo {\\n///      color: tomato;\\n///    }\\n///  }\\n///\\n///  /* No output */\\n///\\n$im-no-media-breakpoint: 'desktop' !default;\\n\\n///\\n/// Selects which media expressions are allowed in an expression for it to be used when media queries\\n/// are not supported.\\n///\\n/// @example scss - This media query will show because it intercepts the static breakpoint and contains only accepted media expressions\\n///  $im-media-support: false;\\n///  $im-no-media-breakpoint: 'desktop';\\n///  $im-no-media-expressions: ('screen');\\n///  @include media('>=tablet', 'screen') {\\n///    .foo {\\n///      color: tomato;\\n///    }\\n///  }\\n///\\n///   /* Generates: */\\n///   .foo {\\n///     color: tomato;\\n///   }\\n///\\n/// @example scss - This media query will NOT show because it intercepts the static breakpoint but contains a media expression that is not accepted\\n///  $im-media-support: false;\\n///  $im-no-media-breakpoint: 'desktop';\\n///  $im-no-media-expressions: ('screen');\\n///  @include media('>=tablet', 'retina2x') {\\n///    .foo {\\n///      color: tomato;\\n///    }\\n///  }\\n///\\n///  /* No output */\\n///\\n$im-no-media-expressions: ('screen', 'portrait', 'landscape') !default;\\n\\n////\\n/// Cross-engine logging engine\\n/// @author Hugo Giraudel\\n/// @access private\\n////\\n\\n\\n///\\n/// Log a message either with `@error` if supported\\n/// else with `@warn`, using `feature-exists('at-error')`\\n/// to detect support.\\n///\\n/// @param {String} $message - Message to log\\n///\\n@function im-log($message) {\\n  @if feature-exists('at-error') {\\n    @error $message;\\n  } @else {\\n    @warn $message;\\n    $_: noop();\\n  }\\n\\n  @return $message;\\n}\\n\\n\\n///\\n/// Wrapper mixin for the log function so it can be used with a more friendly\\n/// API than `@if im-log('..') {}` or `$_: im-log('..')`. Basically, use the function\\n/// within functions because it is not possible to include a mixin in a function\\n/// and use the mixin everywhere else because it's much more elegant.\\n///\\n/// @param {String} $message - Message to log\\n///\\n@mixin log($message) {\\n  @if im-log($message) {}\\n}\\n\\n\\n///\\n/// Function with no `@return` called next to `@warn` in Sass 3.3\\n/// to trigger a compiling error and stop the process.\\n///\\n@function noop() {}\\n\\n///\\n/// Determines whether a list of conditions is intercepted by the static breakpoint.\\n///\\n/// @param {Arglist}   $conditions  - Media query conditions\\n///\\n/// @return {Boolean} - Returns true if the conditions are intercepted by the static breakpoint\\n///\\n@function im-intercepts-static-breakpoint($conditions...) {\\n  $no-media-breakpoint-value: map-get($breakpoints, $im-no-media-breakpoint);\\n\\n  @if not $no-media-breakpoint-value {\\n    @if im-log('`#{$im-no-media-breakpoint}` is not a valid breakpoint.') {}\\n  }\\n\\n  @each $condition in $conditions {\\n    @if not map-has-key($media-expressions, $condition) {\\n      $operator: get-expression-operator($condition);\\n      $prefix: get-expression-prefix($operator);\\n      $value: get-expression-value($condition, $operator);\\n\\n      @if ($prefix == 'max' and $value <= $no-media-breakpoint-value) or\\n          ($prefix == 'min' and $value > $no-media-breakpoint-value) {\\n        @return false;\\n      }\\n    } @else if not index($im-no-media-expressions, $condition) {\\n      @return false;\\n    }\\n  }\\n\\n  @return true;\\n}\\n\\n////\\n/// Parsing engine\\n/// @author Hugo Giraudel\\n/// @access private\\n////\\n\\n\\n///\\n/// Get operator of an expression\\n///\\n/// @param {String} $expression - Expression to extract operator from\\n///\\n/// @return {String} - Any of `>=`, `>`, `<=`, `<`, ``, ``\\n///\\n@function get-expression-operator($expression) {\\n  @each $operator in ('>=', '>', '<=', '<', '', '') {\\n    @if str-index($expression, $operator) {\\n      @return $operator;\\n    }\\n  }\\n\\n  // It is not possible to include a mixin inside a function, so we have to\\n  // rely on the `im-log(..)` function rather than the `log(..)` mixin. Because\\n  // functions cannot be called anywhere in Sass, we need to hack the call in\\n  // a dummy variable